import React, { Component } from "react";
import "./App.css";

class App extends React.Component {
  foo = () => "Bars";

  render() {
    const name = "Joey Wilson";
    const loading = false;

    return (
      <div className="App">
        {loading ? <h4>Loading...</h4> : <h1>Hello {name}</h1>}
      </div>
    );
  }
}

export default App;
